import React from "react";
import Aux from "./Auxiliary/Auxiliary"

const ToDoList = (props) => {
    const deleteItems = () => {
        console.log ("hi");
    }
    return( 
        <Aux>
        <div className = "todo_style">
        <i  class = "fas fa-portal-exit"  aria-hidden = "true" onClick = {deleteItems} />
        <li>{props.text}</li>
        </div>
        
        </Aux>
        )
}

export default ToDoList;
